import React from 'react';

import styles from './Project1.module.css';

function Project1() {
    return (
        <React.Fragment>
            <h1>
                <img alt="Back" className="back-button" width="25rem" src="https://image.flaticon.com/icons/png/512/60/60577.png"/>
                Job Scrapper
            </h1>
            <div classname={styles['project-div']}></div>
        </React.Fragment>
    );
};

export default Project1;
